import Vue from 'vue'
import VueRouter from 'vue-router';
import App from './App.vue'
import Home from './components/Home.vue';
import Projects from './components/Projects.vue'; // Créez ce composant si nécessaire
import About from './components/About.vue'; // Créez ce composant si nécessaire
import Contact from './components/Contact.vue';

Vue.config.productionTip = false
Vue.use(VueRouter);

const router = new VueRouter({
  routes: [
    { path: '/', component: Home}
]});

new Vue({
  render: h => h(App),
  router,
}).$mount('#app')
